import React from 'react';
import { createGlobalStyles } from 'styled-components';

const GlobalStyle = createGlobalStyles`
  body {
    font-family: 'Open Sans', sans-serif;
  }

  h1, h2, h3 {
    font-family: 'Righteous', cursive;

  }
`
function App() {
  return (
    <>

      <h1>Pizzaria</h1>
      <GlobalStyle/>
      <div>Myltiane</div>
    </>  
  );
}

export default App;
